import React from 'react'
import { NavLink } from 'react-router-dom'
import PostTweet, { withModal } from './Navbar-components/PostModal'
const SignedInLink = ({toggleModal, isModalVisible}) => {
  return (
    <ul className='right'>
      {isMovalVisible && (
        <PostTweet handleClose={() => toggleModal(!isModalVisible)}>Modal1</PostTweet>
      )}
      <button onClick={() => toggleModal(!isModalVisible)}>Open</button>
      <li><NavLink to='/' className='btn btn-floating pink lighten-1'>SM</NavLink></li>
    </ul>
  )
}
export default SignedInLink
